import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import {BrowserRouter} from "react-router-dom";
import './light.css';

const dval=localStorage.getItem('dark');
console.log(JSON.parse(dval));

ReactDOM.render(
  <BrowserRouter>
      <App />
    </BrowserRouter>
,
  document.getElementById('root')
);
